import React from 'react';

import { projectsData } from '../utils/projectsData';

export default function Projects() { 
    const [data] = useState(projectsData)

    return (
        <div className='clients-name'>
            {data.map((project, i) => (
                <div className='project-name'>
                    <h3>{project.name}</h3>

                </div>
            ))}
        </div>
    )
}
